import Map from "react-map-gl";
import "./Map.css";

const MAPBOX_TOKEN =
  "pk.eyJ1IjoiYnJva2VjaGlnZ2EiLCJhIjoiY2xmdWRoODlnMDl0YzNqbnB5OHhxOG5nciJ9.3PkRvWlj8Qk0MIeEX_NYKQ";

function Mapbox() {
  return (
    <Map
      initialViewState={{
        longitude: -122.4,
        latitude: 37.8,
        zoom: 14,
      }}
      mapboxAccessToken={MAPBOX_TOKEN}
      style={{ position: "absolute", width: "100%", top: 0, bottom: 0 }}
      mapStyle="mapbox://styles/mapbox/streets-v12"
    />
  );
}

export default Mapbox;
